import React, { Component } from "react";
import { Link } from "react-router-dom";

import { connect } from "react-redux";
import { PropTypes } from "prop-types";
import { deleteProject } from "../actions/DocumentsActions";

class Content extends Component {

  render() {
    const { document } = this.props;

    return (
      <div className="container">
        <div className="card card-body bg-light mb-3">
          <div className="row">
            <div className="col-2">
              <span className="mx-auto">{document.document_id}</span>
            </div>
            <div className="col-lg-6 col-md-4 col-8">
              <h3>{document.documentName}</h3>
              <p>{document.description}</p>
            </div>
            <div className="col-md-4 d-none d-lg-block">
              <ul className="list-group">
                <a href="#">
                  <li className="list-group-item board">
                    <i className="fa fa-flag-checkered pr-1"> document Board </i>
                  </li>
                </a>
                <Link to={`/updatedocument/${document.documentIdentifier}`}>
                  <li className="list-group-item update">
                    <i className="fa fa-edit pr-1"> Update document Info</i>
                  </li>
                </Link>

                <li
                  className="list-group-item delete"
                  onClick={this.onDeleteClick.bind(
                    this,
                    document.documentIdentifier
                  )}
                >
                  <i className="fa fa-minus-circle pr-1"> Delete document</i>
                </li>
              </ul>
            </div>
          </div>
        </div>
      </div>
    );
  }
}


export default Content;
